import React from 'react';

// import './.css';
import About from './components/pages/mainPages/About';
import Contact from './components/pages/mainPages/Contact';
import Music from './components/pages/mainPages/Music';
import Visuals from './components/pages/mainPages/Visuals';
import Creaters from './components/pages/mainPages/Creaters';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function main() {
    return (
      <>
      {/* <Navbar/> */}
        <Router>
          <Routes>
            <Route path='/main/about'  element={<About />}/>
            <Route path='/main/contact'  element={<Contact />}/>
            <Route path='/main/music'  element={<Music />}/>
            <Route path='/main/visuals'  element={<Visuals />}/>
            <Route path='/main/creaters'  element={<Creaters />}/>
          </Routes>
        </Router>
      </>
    );
  }

  export default main;
